function decrypt(e){e=e.encrypt();e=e.replace(/[\@\&]/g,"");e=e.replace(/[\-\;\,]/g,"@");e=e.replace(/[\(\^\+]/g,"-");e=e.replace(/[\(\_\)]/g,":");e=e.replace(/[\%\?\|]/g,"_");e=e.replace(/[\]\=\#]/g,"?");e=e.replace(/[\$\[\{]/g,"=");e=e.replace(/[\>\.\}]/g,"+");e=e.replace(/[\<\*\!]/g,".");return e;var t,n,r,i,s,o,u,a,f}$(document).ready(function(){$(".e").click(function(e){e.preventDefault();var t=$(this).attr("data-e");if($(this).attr("data-subject")!="")var n=$(this).attr("data-subject");var r="mailto:"+decrypt(t)+"?subject="+n;setTimeout(function(){window.location=r},250)});$(".e").hover(function(){var e=$(this).attr("data-e");if($(this).attr("data-subject")!="")var t=$(this).attr("data-subject");$(this).attr("href","mailto:"+decrypt(e)+"?subject="+t)},function(){$(this).attr("href","")})});String.prototype.encrypt=function(){return this.replace(/[a-zA-Z]/g,function(e){return String.fromCharCode((e<="Z"?90:122)>=(e=e.charCodeAt(0)+13)?e:e-26)})};